// import Page from "./Common_page/Page";
import login_img from "../../../img/login.jpg";
import TextField from "@material-ui/core/TextField";
import { makeStyles } from "@material-ui/core/styles";
const useStyles = makeStyles((theme) => ({
  root: {
    "& > *": {
      margin: theme.spacing(1),
      width: "25ch",
    },
  },
}));
const Home = () => {
  return (
    <>
      <div className="bg">
        <div className="clild_div shadow">
          <div className="row">
            <div className="col-6">
              <div className="login_img_div">
                <div
                  className="login_img"
                  style={{ backgroundImage: `url(${login_img})` }}
                ></div>
              </div>
            </div>
            <div className="col-6">
              <div className=" p-3">
                <form className={classes.root} noValidate autoComplete="off">
                  <TextField
                    id="outlined-basic"
                    label="Outlined"
                    variant="outlined"
                    className=" w-100"
                  />
                </form>
              </div>
            </div>
          </div>
        </div>
      </div>
    </>
  );
};

export default Home;
